package productinventory_backend.productinventory.model;import lombok.AllArgsConstructor;import javax.persistence.*;import javax.validation.constraints.NotNull;@Entity@Table@AllArgsConstructorpublic class Product {    @Id    @NotNull    @GeneratedValue(strategy = GenerationType.AUTO)    private long id;    @Column(name="productName")    private String productName;    @Column(name="productCategory")    private String productCategory;    @Column(name="date")    private String date;    @Column(name="productCondition")    private String productCondition;    @Column(name="price")    private String price;    @Column(name="comment")    private String comment;    @Column(name="description")    private String description;    @Column(name="remaining")    private String remaining;    @Column(name="total")    private String total;    public Product() {    }    public Product(String productName, String productCategory, String date, String price,String productCondition, String comment, String description, String remaining,String total) {        this.productName = productName;        this.productCategory = productCategory;        this.date = date;        this.productCondition = productCondition;        this.price = price;        this.comment = comment;        this.description = description;        this.total=total;        this.remaining=remaining;    }    public long getId() {        return id;    }    public void setId(long id) {        this.id = id;    }    public String getProductName() {        return productName;    }    public void setProductName(String productName) {        this.productName = productName;    }    public String getProductCategory() {        return productCategory;    }    public void setProductCategory(String productCategory) {        this.productCategory = productCategory;    }    public String getDate() {        return date;    }    public void setDate(String date) {        this.date = date;    }    public String getProductCondition() {        return productCondition;    }    public void setProductCondition(String productCondition) {        this.productCondition = productCondition;    }    public String getPrice() {        return price;    }    public void setPrice(String price) {        this.price = price;    }    public String getComment() {        return comment;    }    public void setComment(String comment) {        this.comment = comment;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }    public String getRemaining() {        return remaining;    }    public void setRemaining(String remaining) {        this.remaining = remaining;    }    public String getTotal() {        return total;    }    public void setTotal(String total) {        this.total = total;    }}